/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_billing_before_update_total` BEFORE UPDATE ON `billing` FOR EACH ROW BEGIN
    -- Force NULL safety
    SET NEW.water_charge     = IFNULL(NEW.water_charge, 0);
    SET NEW.discount_amount  = IFNULL(NEW.discount_amount, 0);
    SET NEW.tax_amount       = IFNULL(NEW.tax_amount, 0);
    SET NEW.scf_amount       = IFNULL(NEW.scf_amount, 0);
    SET NEW.arrears_amount   = IFNULL(NEW.arrears_amount, 0);
    SET NEW.penalty_amount   = IFNULL(NEW.penalty_amount, 0);

    -- Compute total
    SET NEW.total_amount =
          NEW.water_charge
        - NEW.discount_amount
        + NEW.tax_amount
        + NEW.scf_amount
        + NEW.arrears_amount
        + NEW.penalty_amount;
END */;;
DELIMITER ;
